(52, 'picture-framing-rockdale', 'picture-framing-rockdale', '', '', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-03-12 20:22:18', '2017-03-12 20:22:18', NULL, 0),
(53, 'Product Description', 'product-description', '', '<h2>Custom Picture Frames</h2><p>Be your own designer with our online custom picture framing service. At Off The Wall, we created Australia''s first online framing service with live previews of the frames you create. You get to see your designs as they happen and tweak it until you have the perfect frame for your art, photos or memorabilia. Off The Wall (or more locally known as A&amp;H Off The Wall) has been professionally making picture frames for over 25 years. We hand make all our frames in our Sydney based showroom and factory, and ship them Australia wide. </p><p>Our custom picture frames can be as simple or as complex as you choose. We give you the tools to create the perfect picture frame for your piece. Whether it is a limited edition artwork, or a simple family photo. Off The Wall makes all frames to order within our Sydney based factory, and use the highest quality materials to achieve the best finished products. Be sure to contact us for suggestions on your framing, all advice and quotations are free!</p>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 05:04:53', '2017-06-13 05:04:53', NULL, 0),
(54, 'How to Order', 'how-to-order', '', '<h2>How to order a custom picture frame online</h2><p>We aim to keep this as simple, but as deep as possible. With our frame creator you can create a large variety of custom frames with millions of possible combinations. It helps having a guide to achieve what you want, we will aim to make this the most comprehensive online framing guide. The following guide will cover most cases of a custom picture frame and will explain the recommended options.\r\n			</p><ol>\r\n				<li>Enter your photo or artwork size, then click on Add a Frame:\r\n					<ol type="a">\r\n						<li>If your photo or artwork is a standard size, you can find it in our list above.\r\n						</li>\r\n						<li>Our system will build all your selections around your photo size. Please keep in mind that frames will overlap the entered size by about 4-6mm on all sides. Matboards will do the same by about 3-5mm. The ''Visible'' size is an approximation of the area including this overlap, please note that if you require a particular visible size we must be notified. Also the overlap amount will vary based on sizes and selections.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>Select a frame, you can always change this as you go.\r\n					<ol type="a">\r\n						<li>To view different sets of frames, select a colour set from the dropdown list.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a matboard:\r\n					<ol type="a">\r\n						<li>You can choose from a variety of colours to suit your frame and artwork.</li>\r\n						<li>We offer double mats too.</li>\r\n						<li>Be sure to select the thickness you would like the border to be.<br/> A (very) general rule is to match the frame width or keep it in ratio.<br/> The frame will overlap approximately 4mm on all sides of the border.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a backing:\r\n					<ol type="a">\r\n						<li>By default you will receive 3mm MDF.</li>\r\n						<li>Foamcore is an acid free product that will protect your pictures from colour fading. It is also lighter than MDF.<br/> We recommend using foamcore for most works. Use non-adhesive for original artworks/certificates.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a glass type:\r\n					<ol type="a">\r\n						<li>The default glass type is 2mm Clear Glass.</li>\r\n						<li>Non Reflective should be used in areas with lots of potential glare from natural or artificial light sources.\r\n						</li>\r\n						<li>UV Resistant Glass should be used for frames that will face direct sunlight.\r\n						</li>\r\n						<li>Perspex is highly recommended as it is durable, light and comes with 94% UV Resistance. It looks the same as clear glass and will not fade or become cloudy over time.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n			</ol>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 05:05:44', '2017-06-13 05:05:44', NULL, 0),
(55, 'Shipping & Returns', 'shipping-returns', '', '<h3>Shipping</h3>\r\n			<p>We aim to ship our custom frames within 2 business days of the order coming through. Please note printing, matting and mounting options will add 1-2 business days to the production time. Depending on the location and size of the order shipping times can vary greatly, if you require anything urgently please contact us.</p>\r\n			<h3>Returns</h3>\r\n			<p>If you are not completely satisfied with the quality of the product you purchase from Off The Wall, you may return it within 7 days of the receiving date, for a full refund for the price of the product.\r\n			</p>\r\n			<p>All expenses associated with transportation of returns are the responsibility of the customer.\r\n			</p>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 05:06:44', '2017-06-13 05:06:44', NULL, 0);

