(8, NULL, 10, 9, 'Circle Bathroom mirror', 'circle-bathroom-mirror', '<p>This Circle bathroom mirror can be both stylish and functional featuring a striking circle shape. It comes complete with all the necessary fittings for a quick and easy installation.</p>\r\n\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror</li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n\r\n<p>We have different sizes with this design to match your requirements.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>M3</td></tr>\r\n<tr><td>Sizes</td><td>760 mm diameter</td></tr>\r\n<tr><td>Price</td><td>Price available upon request.</td></tr><tr>\r\n<td>Price</td><td>$199</td></tr><tr>\r\n<td>Special Price</td><td>$140</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>6</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '199', '220', NULL, NULL, NULL, '3', 'no', 0, 0, '2016-03-13 19:01:01', '2017-03-20 08:36:26', 'Yes', 'uploads/product_image/998circle-bathroom-mirror.jpg', 'uploads/product_image/thumb_760_circle-bathroom-mirror.jpg', '', '', '', '', '', 4, 0, 300, '', '1025 X 960 mm', '', 'aaa', '', '111', '2222hhhhhhhhhhhhhhhhhhhhh'),
(9, NULL, 10, 9, 'Oval Bathroom mirror', 'oval-bathroom-mirror', '<p>Our mirrors are tested to deal with high humidity areas like our bathroom; however not limited and Ideal for use in any room, this Bevel edged oval bathroom mirror can add stylish practicality to any space. It comes complete with all the necessary fittings for a quick and easy installation. </p>\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror </li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n<p>We can customize the product as per your size requirement.</p>', '<table class="table">\r\n<tr><td>Product Code</td><td>M1</td></tr>\r\n<tr><td>Sizes</td><td>870 x 580 mm</td></tr>\r\n<td>Price</td><td>$190</td></tr><tr>\r\n<td>Special Price</td><td>$120</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>11</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '190', NULL, NULL, NULL, NULL, '10', 'no', 0, 0, '2016-03-13 19:06:26', '2016-05-02 19:29:36', 'Yes', 'uploads/product_image/390oval-bathroom-mirror.jpg', 'uploads/product_image/thumb_782_oval-bathroom-mirror.jpg', '', '', '', '', '', 0, 0, NULL, NULL, '1025 X 960 mm', NULL, NULL, NULL, '', ''),
(10, NULL, 10, 9, 'Rectangle Bathroom mirror', 'rectangle-bathroom-mirror', '<p>Our mirrors are tested to deal with high humidity areas like our bathroom. Ideal for use in any room, this silver framed rectangular bathroom mirror can be hung either horizontally or vertically, depending on your needs. \r\nIt comes complete with all the necessary fittings for a quick and easy installation. \r\n</p>\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror </li>\r\n	<li>Can be hung horizontally or vertically</li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n<p>We can customize the product as per your size requirement.</p>', '<table class="table">\r\n<tr><td>Product Code</td><td>M1</td></tr>\r\n<tr><td>Sizes</td><td>750 x 1000 mm</td></tr>\r\n<td>Price</td><td>Price available upon request.</td></tr><tr>\r\n<td>Price</td><td>$80</td></tr><tr>\r\n<td>Special Price</td><td>$60</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>14</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '80', NULL, NULL, NULL, NULL, '9', 'no', 0, 0, '2016-03-13 19:08:09', '2016-04-30 05:48:31', 'Yes', 'uploads/product_image/310rectangle-bathroom-mirror.jpg', 'uploads/product_image/thumb_747_rectangle-bathroom-mirror.jpg', '', '', '', '', '', 0, 0, NULL, NULL, '960 X 1025 mm', NULL, NULL, NULL, '', ''),
(11, NULL, 10, 12, 'Black Ornate Square Mirror', 'black-ornate-square-mirror', '<p>A mirror personalizes your home; it complements your furniture and creates an attractive focal point.</p>\r\n\r\n<p>This black ornate square mirror will grace any living area, hallway or bedroom with its beautifully ornate frame.</p>\r\n\r\n<p>And it also comes in white, gold or silver color finish.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>OM2</td></tr>\r\n<tr><td>Sizes</td><td>1000 x 1000 mm</td></tr>\r\n<td>Price</td><td>Price available upon request.</td></tr><tr>\r\n<td>Price</td><td>$520</td></tr><tr>\r\n<td>Special Price</td><td>$480</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>5</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '520', '230', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-03-13 19:10:32', '2016-05-02 17:39:28', 'Yes', 'uploads/product_image/354BLACK-ORNATE-MIRROR.jpg', 'uploads/product_image/thumb_241_BLACK-ORNATE-MIRROR.jpg', '', '', '', '', '', 120, 0, 100, '', '100 X 200 mm', '', 'hello', 'outside australia', '', ''),
(12, NULL, 10, 12, 'Round Decorative mirror', 'round-decorative-mirror', '<p>A mirror personalizes your home; it complements your furniture and creates an attractive focal point.</p>\r\n<p>This round decorative mirror will grace any living area or hallway with its beautifully ornate frame and striking circle shape.</p>\r\n<p>And it also comes in white, gold or silver color finish.</p>', '<table class="table">\r\n<tr><td>Product Code</td><td>OM1</td></tr>\r\n<tr><td>Sizes</td><td>760 mm diameter (including frames)</td></tr>\r\n<td>Price</td><td>$452</td></tr><tr>\r\n<td>Special Price</td><td>$400</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>4</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '450', NULL, NULL, NULL, NULL, '4', 'no', 0, 0, '2016-03-13 19:19:23', '2016-03-14 20:09:10', 'Yes', 'uploads/product_image/245ROUND-DECORATIVE-MIRROR.jpg', 'uploads/product_image/thumb_284_ROUND-DECORATIVE-MIRROR.jpg', '', '', '', '', '', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(13, NULL, 10, 12, 'Silver Ornate Mirror', 'silver-ornate-mirror', '<p>This silver Ornate mirror has a perfect finish and elaboration which is ideal to go over a mantel. A classic and elegant piece that can elevate the space its in.</p>', '<table class="table">\r\n<tr><td>Product Code</td><td>OM3</td></tr>\r\n<tr><td>Sizes</td><td>1000 x 800 mm</td></tr>\r\n<td>Price</td><td>$480</td></tr><tr>\r\n<td>Special Price</td><td>$420</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>8</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '480', NULL, NULL, NULL, NULL, '8', 'no', 0, 0, '2016-03-13 19:21:13', '2016-03-14 20:12:11', 'Yes', 'uploads/product_image/872SILVER-ORNATE-MIRROR.jpg', 'uploads/product_image/thumb_285_SILVER-ORNATE-MIRROR.jpg', '', '', '', '', '', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(14, NULL, 10, 17, 'Free Standing Mirror', 'free-standing-mirror', '<p>This antique design, ornate, wall mirror will make a beautiful addition to any room in the house, from the dining room to the bedroom. this can bring the functionality and the style on any place it be. We have different sizes to match your requirements.</p>', '<table class="table">\r\n<tr><td>Product Code</td><td>M2</td></tr>\r\n<tr><td>Sizes</td><td>750 x 1000 mm</td></tr>\r\n<td>Price</td><td>$320</td></tr><tr>\r\n<td>Special Price</td><td>$280</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>8</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '320', NULL, NULL, NULL, NULL, '4', 'no', 0, 0, '2016-03-13 19:23:22', '2016-03-14 20:14:07', 'Yes', 'uploads/product_image/461FREE-STANDING-MIRROR.jpg', 'uploads/product_image/thumb_845_FREE-STANDING-MIRROR.jpg', '', '', '', '', '', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(15, NULL, 10, 17, 'Neat Floor Mirror', 'neat-floor-mirror', '<p>Full Length Free Standing Mirror, with Silver beaded trim with Bevel Edges. A mix between classical and modern style sure to stun anyone and any place. We have different sizes to match your requirements.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>FSM1</td></tr>\r\n<tr><td>Sizes</td><td>2000 x 1100 mm</td></tr>\r\n<td>Price</td><td>$280</td></tr><tr>\r\n<td>Special Price</td><td>$250</td></tr><tr>\r\n<td>Price after Delivery</td><td>0</td></tr><tr>\r\n<td>Stock Level</td><td>18</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '280', '', NULL, NULL, NULL, '18', 'no', 0, 0, '2016-03-13 19:30:53', '2016-04-23 03:22:26', 'Yes', 'uploads/product_image/63287177Untitled-1.png', 'uploads/product_image/thumb_230_87177Untitled-1.png', '', '', '', '', '', 0, 0, 0, '', '', '', 'mmmmm', '', '', ''),
